import React from 'react'

function Frontdata({idata}) {
    const Gamedata=data.map((Game)=>{
        if(Game.id<10){
          return(
            <div  key={Game.id}>
              
           <a href={Game.game_url}><div  style={{backgroundImage:`url(${Game.thumbnail})`}} className="img">
            </div></a> 
            </div>
          )
        }
      })
  return (
   {Gamedata}
  )
}

export default Frontdata
